const books = {};
feed.rss.channel.item.forEach(item => {
   let title = item.title[0];
   const mp3 = item.enclosure['_url'];
   // const outline = mp3.substr(mp3.lastIndexOf('/') + 1).replace('.mp3', '.doc');
   title = title.replace('Song of Solomon', 'SongofSolomon');
   const parts = title.split(' ');
   let bookName;
   let bookChapter;
   let chapterVerse;
   if(parts[0] === '1' || parts[0] === '2' || parts[0] === '3' || parts[0] === '4') {
      bookName = parts[0] + ' ' + parts[1];
      bookChapter = +(parts[2].split(':')[0]);
      verse = parseInt(parts[2].split(':')[1]);
   } else {
      bookName = parts[0].replace('SongofSolomon', 'Song of Solomon');
      bookChapter = +(parts[1].split(':')[0]);
      verse = parseInt(parts[1].split(':')[1]);
   }

   const study = {
      title: title.replace('SongofSolomon', 'Song of Solomon'), 
      audio: mp3, 
      // outline: outline,
      verse: verse ? verse : 0
   }

   if (!books[bookName]) {
      books[bookName] = [];
      books[bookName][bookChapter - 1] = {
         chapter: bookChapter,
         studies: [study] 
      }
   } else {
      if(!books[bookName][bookChapter - 1]) {
         books[bookName][bookChapter - 1] = {
            chapter: bookChapter,
            studies: [study] 
         }
      }else{
         books[bookName][bookChapter - 1].studies.push(study);
      }
   }
});

// sort studies by verse
for (const book in books) {
   for (const chapter in books[book]) {
      if(books[book][chapter]) {
         const studies = books[book][chapter].studies;
         let uniq = {}
         books[book][chapter].studies = studies.sort((a, b) => a.verse - b.verse).filter(study => !uniq[study.title] && (uniq[study.title] = true));
         for (const study in books[book][chapter].studies)
            delete books[book][chapter].studies[study].verse;
      }
   }
 }

fs.writeFile('data/audio-ot.js', `export default ${JSON.stringify(books, null, 2)}`, function(){console.log('done')});